description:
Ninja (2009)  

Verenigde Staten
Actie

geregisseerd door Isaac Florentine
met Scott Adkins, Tsuyoshi Ihara en Mika Hijii

Een westerling genaamd Casey, die Ninjutsu in Japan studeert, wordt gevraagd terug te keren naar New York om de legendarische Yoroi Bitsu, een gepantserde kist waarin de wapens van de laatste Koga ninja zitten, te beschermen.

Video aspect ratio: 4:3
Ondertiteling: Gonnie


